// src\components\Home.js

import React from 'react';
import styled from 'styled-components';

const HomeWrapper = styled.div`
  text-align: center;
  padding: 2rem;
`;

function Home() {
  return (
    <HomeWrapper>
      <h1>Welcome to My Portfolio</h1>
      <p>Brief introduction about yourself, your background, and your skills.</p>
    </HomeWrapper>
  );
}

export default Home;
